    public List<AddInfoEventEventResponse> getAddInfoEventEvents(TransactionReceipt transactionReceipt) {
        List<EventValuesWithLog> valueList = extractEventParametersWithLog(ADDINFOEVENT_EVENT, transactionReceipt);
        ArrayList<AddInfoEventEventResponse> responses = new ArrayList<AddInfoEventEventResponse>(valueList.size());
        for (EventValuesWithLog eventValues : valueList) {
            AddInfoEventEventResponse typedResponse = new AddInfoEventEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.id = (BigInteger) eventValues.getNonIndexedValues().get(0).getValue();
            typedResponse.ipadd = (String) eventValues.getNonIndexedValues().get(1).getValue();
            typedResponse.macvalue = (String) eventValues.getNonIndexedValues().get(2).getValue();
            typedResponse.date = (String) eventValues.getNonIndexedValues().get(3).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

    public Observable<AddInfoEventEventResponse> addInfoEventEventObservable(EthFilter filter) {
        return web3j.ethLogObservable(filter).map(new Func1<Log, AddInfoEventEventResponse>() {
            @Override
            public AddInfoEventEventResponse call(Log log) {
                EventValuesWithLog eventValues = extractEventParametersWithLog(ADDINFOEVENT_EVENT, log);
                AddInfoEventEventResponse typedResponse = new AddInfoEventEventResponse();
                typedResponse.log = log;
                typedResponse.id = (BigInteger) eventValues.getNonIndexedValues().get(0).getValue();
                typedResponse.ipadd = (String) eventValues.getNonIndexedValues().get(1).getValue();
                typedResponse.macvalue = (String) eventValues.getNonIndexedValues().get(2).getValue();
                typedResponse.date = (String) eventValues.getNonIndexedValues().get(3).getValue();
                return typedResponse;
            }
        });
    }

    public Observable<AddInfoEventEventResponse> addInfoEventEventObservable(DefaultBlockParameter startBlock, DefaultBlockParameter endBlock) {
        EthFilter filter = new EthFilter(startBlock, endBlock, getContractAddress());
        filter.addSingleTopic(EventEncoder.encode(ADDINFOEVENT_EVENT));
        return addInfoEventEventObservable(filter);
    }

